import React, { useState,useEffect,Component } from 'react';
import "../styles/charadata.css"
import Axios from 'axios'
function Weapondata(){
  
  const[weapName,setweapName] = useState("");
  const[descw,setdescw] = useState("");
  
  const[rarity,setrarity] = useState("");
  const[type,settype] = useState("");
  
  const { id, className, header, body, footer } = this.props;

  const submitdata = () =>{
    Axios.post("http://localhost:3001/",{})
  }
    
    return (
      <div id="myModal" className="modal">
        <div className="modal-content">
          <div className="modal-header">
            <span className="close" onClick={this.closeCustomModal}>
              &times;
            </span>
            <h2>Weapon Data</h2>
          </div>

          <div className="modal-body">
          <form>
            <label>Name:
              <input type="text" onChange={(e)=>{
                setweapName(e.target.value);
              }}/>
            </label>
           
              <div>
                {'\n'}
              </div>
              <label for="rarity">Rarity?</label>
              <select id="vis" name="element" onChange={(e)=>{
                setrarity(e.target.value);
              }}>
                <option value="5star">5 Star</option>
                <option value="4star">4 Star</option>
                <option value="3star">3 Star</option>
              </select>
              <div>
                {'\n'}
              </div>
              <label for="weapon">Weapon type?</label>
              <select id="vis" name="element" onChange={(e)=>{
                settype(e.target.value);
              }}>
                <option value="sword">Sword</option>
                <option value="catalyst">Catalyst</option>
                <option value="bow">Bow and arrow</option>
                <option value="Spear">Polearm</option>
                <option value="catalyst">Claymore</option>
              </select>

              <div>
                {'\n'}
              </div>
              <label>Description</label>
                <input type="text" onChange={(e)=>{
                setdescw(e.target.value);
              }}/>
              
              <div>
                {'\n'}
              </div>
              <button onClick={submitdata}>Submit</button>
          </form>
          </div>
        </div>
      </div>
    );
  }

export default Weapondata;
